create table user_point_pools
(
    id              int unsigned auto_increment
        primary key,
    user_id         int unsigned                       not null comment '用户ID',
    store_id        int unsigned                       not null comment '店铺ID',
    pool_type       tinyint                            not null comment '积分池类型，0：平价区积分池、1：活动区积分池',
    total_point     int unsigned                       not null comment '累计积分点数',
    delivered_point int unsigned                       not null comment '累计已发放的积分点数',
    remaining_point int unsigned                       not null comment '剩余待发放的积分点数',
    created_at      datetime default CURRENT_TIMESTAMP not null,
    updated_at      datetime                           null,
    deleted_at      datetime                           null
)
    collate = utf8mb4_unicode_ci;

create index user_point_pools_pool_type_index
    on user_point_pools (pool_type);

create index user_point_pools_store_id_index
    on user_point_pools (store_id);

create index user_point_pools_user_id_index
    on user_point_pools (user_id);

